package frc.robot;

import edu.wpi.first.wpilibj.DriverStation;
import edu.wpi.first.wpilibj.TimedRobot;
import edu.wpi.first.wpilibj2.command.Command;
import edu.wpi.first.wpilibj2.command.CommandScheduler;


/*
 * Los métodos de esta clase se llaman automáticamente correspondiente a cada modo, como se describe en
 * la documentación de TimedRobot. Si cambia el nombre de esta clase o el paquete después de crear
 * este proyecto, también debe actualizar el archivo de manifiesto en el directorio de recursos.
 * 
 * ¿Que significa esto?
 * Significa que por default se llama Robot.java si le cambiamos el nombre a patata.java este tiene que cambiar todas las cosas que tenga
 * los recursos ya sea movimiento, intake, etc a patata pero para evitar rollos lo dejamos asi.
 */
public class Robot extends TimedRobot {

  private Command m_Autonomo;

  private Controles m_Controles;


  /* Llamado una vez al principio del programa del robot. 
   * Llama a la clase robot que tenemos arriba
  */
    //Sobreescribeme, porfa! 
  @Override
  public void robotInit() {
    //esto lo que hace es basicamente de los controles de la parte de controles.java se lleva todo lo que tiene de parte del movimiento etc etc
    //lo hereda hasta aqui y basicamente tenemos, controles sin tener que hacer tanto choro.

    m_Controles = new Controles();
    DriverStation.silenceJoystickConnectionWarning(true);// ojo silencia cualquier alerta de conexion ej
    //Warning at edu.wpi.first.wpilibj.DriverStation.reportJoystickUnpluggedWarning(DriverStation.java:1346): Joystick Button 8 on port 0 not available, check if controller is plugged in
    //Tengan cuidado ya que si realmente falla el control no sabremos poque
  
  }
  //Sobreescribeme, X2 XD.
  @Override
  public void robotPeriodic() {
    //esto agarra el comando del movimiento, elevador y garra para poder usarlo en un joystick, creeme no quiero hacer comandos para todos, para los auto si.
    CommandScheduler.getInstance().run();
  }

  /* Esta función se ejecuta una vez cada vez que el robot entra en modo autónomo. */
  @Override
  public void autonomousInit() {
    m_Autonomo = m_Controles.getAutonomousCommand();

    // schedule the autonomous command (example)
    if (m_Autonomo != null) {
      m_Autonomo.schedule();}
  
  }

  /* Esta función se llama periódicamente durante la autonono. */
  @Override
  public void autonomousPeriodic() {
  
  }

  /* Esta función se llama una vez cada vez que el robot entra en modo teleoperado. */
  @Override
  public void teleopInit() {CommandScheduler.getInstance().cancelAll();}

  /* Esta función se llama periódicamente durante el modo teleoperado. */
  @Override
  public void teleopPeriodic() {
    
  }

  /* Esta función se llama una vez cada vez que el robot entra en modo de prueba. */
  @Override
  public void testInit() {}

  /* Esta función se llama periódicamente durante el modo de prueba. */
  @Override
  public void testPeriodic() {}
}

